import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <nav>
          <ul>
            <li className='active'>Home</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </nav>
      </header>
    </div>
  );
}
function Home() {
  return (
    <div className="App">
      <header>
        <nav>
          <ul>
            <li className='active'>Home</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </nav>
      </header>
      <div className='main'>
        <button>Start</button>
      </div>
    </div>
  );
}

export default App;
